import React from 'react'
import {FaInstagramSquare} from "react-icons/fa";

function Footer() {
  return (
    <div className="footer">
        <p className="copyright">Onur Yıldırım 2022</p>
        <div className="footer-links">
<FaInstagramSquare/>
        </div>
    </div>
  )
}

export default Footer
